  jQuery('#newsletter-label').each(function(i, e){
    var lnk = jQuery(e);
    var lnkText = lnk.attr('data-text');
    if(!lnkText){
      return;
    }
    
   
    var maxLen = 0;
    for(var i = 1; i <= 3; i++){
      var len = lnk.attr('data-replacing-text' + i).length;
      if(len > maxLen){
        maxLen = len;
      }
    } 
    
    for(var i = 1; i <= 3; i++){
      var lnkText = lnk.attr('data-replacing-text' + i);
      var lnkTextLength = lnkText.length;
      
      for(var k = 0; k < maxLen - lnkTextLength; k++  ){
        lnkText += ' ';
      }
      
      lnk.attr('data-replacing-text' + i, lnkText);
    } 
    
    var interval;
    var reverseInterval;
    var index = 0;
    var lnkTextCurent = lnkText;
    if(!lnkTextCurent)
      return;
      
    var speed = 20;  
    
    var itteration = 1;
    setInterval( function(){
    
    itteration++;
    
    if(itteration > 3){
      itteration = 1;
    }
    
    var prevIt = itteration - 1;
    if(prevIt < 1){
      prevIt = 3;
    }
    
    lnkTextCurent =  lnk.attr('data-replacing-text' + prevIt);
    lnkReplacingText = lnk.attr('data-replacing-text' + itteration);
    lnkReplacingTextLength = maxLen;//lnkReplacingText.length;
    lnkTextCurent = new Array(maxLen + 1).join( " " ); 
    
    
     clearInterval(reverseInterval);
     clearInterval(interval);
      //index = 0;
      interval = setInterval(function(){
         //lnkTextCurent[index] = lnkReplacingText[index];
         lnkTextCurent = lnkTextCurent.replaceAt(index, lnkReplacingText[index] );
         
         lnk.text( lnkTextCurent );

         index++;
         
         if( index >= lnkReplacingTextLength ){
           clearInterval(interval);
           index = 0;
         }
          
      }, speed);
    
    
    }, 6000);
    
  });

