function initDiagonals(items, gap){

  
  items.each(function(i, e){
     var block = jQuery(e);
     
     var contentBlock = block.find('.adp-content');
     contentBlock.attr('data-width', contentBlock.width());
     if(!contentBlock[0]){
       return;
     }
     
     contentBlock.css('width','auto');
     
     
     
     var blockInitWidth = contentBlock.outerWidth();
     contentBlock.css('width' , blockInitWidth );
     
     var siblings = block.parent().find('.article-diagonal-post');
     
     var leftSiblings = [];
     var rightSiblings = [];
     var foundCenter = false;
     for(var k = 0; k < siblings.length; k++){
       var sibling = siblings[k];
     
       if(e == sibling){
         foundCenter = true;
         continue;
       }
       
       var sibElement = jQuery(sibling);
       
       if(!sibElement.height()){
          continue;
       }
       
       if(foundCenter){
         rightSiblings.push( sibElement );
       }
       else{
         leftSiblings.push ( sibElement );
       }
        
     }
     
    
     
     var rightSiblingLength = 0;//rightSiblings.length;
     for(var i = 0; i < rightSiblings.length; i++ ){
       if( jQuery(rightSiblings[i]).css('display') != 'none' ){
         rightSiblingLength++;
       }
     
     }
     
     var leftSiblingLength = 0;//leftSiblings.length;
     for(var i = 0; i < leftSiblings.length; i++ ){
       if( jQuery(leftSiblings[i]).css('display') != 'none' ){
         leftSiblingLength++;
       }
     
     }
     
    
     
     block.on('mouseenter', function(){
    
      
       for(var i = 0 ; i < leftSiblingLength; i++){
          var sibling = leftSiblings[i];
          leftSiblings[i].css('left', -(i * gap) + 'px'); 
          
       }
       
       
       if(rightSiblingLength > 1){
         for(var j = rightSiblingLength - 2, k = 0 ; j >= 0; j--,k++){
          var i = (rightSiblingLength - 1) - j ;
          var sibling = rightSiblings[j];
          rightSiblings[j].css('left', (i * gap) + 'px');
         }
       }
       
       if(rightSiblingLength > 0){
         for(var i = 0 ; i < rightSiblingLength; i++){
           var sibling = rightSiblings[i];
           
         }
       
       }
       
       
       
       var extraWidth = Math.ceil ( (leftSiblingLength + rightSiblingLength) * gap ) + 1;
       
       contentBlock.css('width', Math.ceil(blockInitWidth + extraWidth)) ;
       
       if(leftSiblingLength >= 1){
         var leftShift = ((leftSiblingLength  )  * gap);
         contentBlock.css('left', -leftShift + 'px' );
       }
        
     });
     
     block.on('mouseleave', function(){
        for(var i = 0 ; i < leftSiblingLength; i++){
          var sibling = leftSiblings[i];
          leftSiblings[i].css('left',0); 
        
       }
       
       for(var i = 0 ; i < rightSiblingLength; i++){
         var sibling = rightSiblings[i];
         rightSiblings[i].css('left', 0); 
        
       }
       
       contentBlock.css('width', blockInitWidth);
       contentBlock.css('left', 0);
     });
     
  });
}


