function initExcerpts(){
 setTimeout(function(){ 
  jQuery('.list-post .hp-excerpt').each(function(i,e){
      var excerpt = jQuery(e);
      if(excerpt.css('display') == 'none'){
        return;
      }
      
      var excerptParent =  excerpt.parent().parent();
      var excerptParentHeight = excerptParent.parent().height();//isChrome() ? excerptParent.outerHeight() : excerptParent.parent().height() ;
      
      
      var pubInfo = excerptParent.find('.hp-post-pub-info');
      
      if(!pubInfo.position()){
          return;
      }
      
      var pubInfoBottom = pubInfo.position().top + pubInfo.height();
      
     
      
      var initLines = 3;
      
      var exHeightWithGap = excerptParentHeight - 20;//(isSafari() ? 30 : 20) ;
      if(jQuery(window).width() <= 800){
         exHeightWithGap = excerptParent.parent().find('.article-post-img').height();   
      }
      
      var excerptText = excerpt.text();
     
      if(excerpt.attr('data-init-text')){
        excerptText = excerpt.attr('data-init-text');
        excerpt.text( excerptText );
      }
      else{
        excerpt.attr('data-init-text', excerptText); 
      }
      var initLines = 100;
      
      console.log(`${pubInfoBottom} > 0 &&  ${pubInfoBottom} - ${exHeightWithGap} == ${pubInfoBottom - exHeightWithGap} > 0`);
      
      while(  (pubInfoBottom > 0) &&  ( (pubInfoBottom - exHeightWithGap) > 0) && excerptText ){
        
        initLines--;
        //excerpt.addClass('t-clamp-' + initLines);
        excerptText = excerpt.text();
        excerptText = excerptText.replace(/\W*\s(\S)*$/, '...');
        
        if(excerptText == '...'){
          excerpt.text('');
          break;
        }
        excerpt.text(excerptText);
        
        pubInfoBottom = pubInfo.position().top + pubInfo.height();
        
        
        if(initLines == 0){
          break;
        }
      
      }
      
  });
  
  }, 0);
}

function initSides(){
  var block = jQuery('<div>');
  block.addClass('side-lines-block');
  jQuery('body').append(block);
  var step = 1;
  for(var i = 1; i < 30; i += step){
    var span = jQuery('<span>');
    span.height(i);
    span.css('margin-top', Math.max(i,5) );
    block.append(span);
  }
  
  for(var i = 29; i >= 1; i-= step){
    var span = jQuery('<span>');
    span.height(i);
    span.css('margin-top', Math.max(i,5) );
    block.append(span);
  }
  
  
  var rightBlock = block.clone();
  rightBlock.addClass('in-right');
  jQuery('body').append(rightBlock);
}


// For convenience...
Date.prototype.format = function (mask, utc) {
	return dateFormat(this, mask, utc);
};



String.prototype.replaceAt=function(index, character) {
    if(!character)
      return this;
    return this.substr(0, index) + character + this.substr(index+character.length);
}

$.fn.selectRange = function(start, end) {
    if(end === undefined) {
        end = start;
    }
    return this.each(function() {
        if('selectionStart' in this) {
            this.selectionStart = start;
            this.selectionEnd = end;
        } else if(this.setSelectionRange) {
            this.setSelectionRange(start, end);
        } else if(this.createTextRange) {
            var range = this.createTextRange();
            range.collapse(true);
            range.moveEnd('character', end);
            range.moveStart('character', start);
            range.select();
        }
    });
};






